import React from "react"
import axios from "axios";
import { useState, useEffect} from 'react'
import GitHubIcon from '@material-ui/icons/GitHub'
import LinkedInIcon from '@material-ui/icons/LinkedIn'
import { about } from '../../portfolio'
import './Upload.css'
import DragDropFile from "./DragDropFile";
import Output from "./Output";

const Upload = () => {
  const { name, role, description, resume, social } = about

  const [imageProcessed, setImageProcessed] = useState(false)
  const [imageFailed, setImageFailed] = useState(false)
  const [processedImages, setProcessedImages] = useState(false)

if (!imageProcessed) {
  return (
    <div className='about center'>
      <h1> Upload your scans </h1>
      <h2 className='about__role'>A lol </h2>
      <p className='about__desc'>{description && description}</p>
      <DragDropFile setImageProcessed={setImageProcessed} setProcessedImages={setProcessedImages} setImageFailed={setImageFailed}/>
    </div>
  )
} else if (imageProcessed) {
    return (
        <div className='about center'>
        <h1> Upload your scans </h1>
        <h2 className='about__role'>input loading bar here </h2>
      </div>       
    )
}
}

export default Upload
